import React from 'react'
import ReactDom from 'react-dom'

import s, { css } from 'styled-components'


import { GREY_BUTTON, MAIN_GREEN } from '../constants/colors'

//welcome page 

export const NavigationButtons = s.button`
  width: 300px;
  height: 75px; 
  background-color: ${ GREY_BUTTON };
  font-family: Avenir;
  font-size: 24px;
`
export const WelcomeBackground = s.div`
  display: flex;
  justify-content: center;
  align-items: center;
`

export const WColor = css`
  width: 100%;
  height: 100%;
  background-color: ${ MAIN_GREEN };
`
